import React from 'react';

// Import elements
import {
    Banner,
    ArticleWrapper,
    ArticleTitle,
    ArticleSubTitle,
    ArticleQuickLinks,
} from './elements';

const ArticleInner = () => {
    return (
        <>
            <main>

                {/* Banner */}
                <Banner/>

                {/* Article content */}
                <ArticleWrapper>

                    {/* Article title */}
                    <ArticleTitle>
                        The different forms of blockchain
                    </ArticleTitle>

                    {/* Article subtitle */}
                    <ArticleSubTitle>
                        And what we use for our trading platform
                    </ArticleSubTitle>

                    {/* Article quicklinks */}
                    <ArticleQuickLinks>

                    </ArticleQuickLinks>
                </ArticleWrapper>
            </main>
        </>
    )
}

export default ArticleInner;
